import React from 'react';
import { Link } from 'react-router-dom';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <p>&copy; 2023 E-Commerce Tax Calculator</p>
        <div className="footer-links">
          <Link to="/about" className="btn btn-outline btn-secondary btn-sm">About</Link>
          <Link to="/privacy" className="btn btn-outline btn-secondary btn-sm">Privacy Policy</Link>
          <Link to="/terms" className="btn btn-outline btn-secondary btn-sm">Terms of Service</Link>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
